function Player(props) {
    return (
        <div className={"player-card"}>
            <div className={"player-info"}>
                <PlayerImage />
                <PlayerDetails {...props.playerDetails}/>
            </div>
            < KillStats />
            <KillCounter />
        </div>
    )
}

export default Player;
